import { http, HttpResponse } from 'msw'

export const handlers = [

  http.post('/api/users', async (req, res, ctx) => {
    // Parse the JSON request body
    const body = await req.json();

    console.log('Request body:', body)

    return HttpResponse.json({
      plans: [
      { id: 1, name: 'Tom' },
      { id: 2, name: 'Jerry' },
      { id: 3, name: 'Spike' },
      ],
    })
  }),

];
